import axios from 'axios';
import React, { useEffect, useState } from 'react';

function Rows({ movieTitle, fetchUrl }) {
  const [Movies, setMovies] = useState('');
  useEffect(() => {
    async function movieData() {
      const request = await axios.get(fetchUrl);
      setMovies(request);
      return request;
    }
  }, [fetchUrl]);

  return <div></div>;
}

export default Rows;
